import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { Drawer, List, ListItem, ListItemIcon, ListItemText, IconButton } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import YouTubeIcon from '@mui/icons-material/YouTube';
import SubscriptionsIcon from '@mui/icons-material/Subscriptions';
import PersonIcon from '@mui/icons-material/Person';
import HistoryIcon from '@mui/icons-material/History';
import PlaylistPlayIcon from '@mui/icons-material/PlaylistPlay';
import VideoLibraryIcon from '@mui/icons-material/VideoLibrary';
import WatchLaterIcon from '@mui/icons-material/WatchLater';
import ThumbUpAltIcon from '@mui/icons-material/ThumbUpAlt';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import './Navbar.css';
import './App.css';

const App = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [isLightTheme, setIsLightTheme] = useState(false);
  const [isSearchVisible, setIsSearchVisible] = useState(false);
  const [token, setToken] = useState('');
  const [isAdmin, setIsAdmin] = useState(false);

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  const toggleTheme = () => {
    setIsLightTheme(!isLightTheme);
    document.body.classList.toggle('light-theme', !isLightTheme);
  };

  const handleSearchClick = () => {
    setIsSearchVisible(true);
  };

  const handleCloseSearch = () => {
    setIsSearchVisible(false);
  };

  return (
    <Router>
      <nav className={`navbar ${isLightTheme ? 'light-theme' : ''}`}>
        {!isSearchVisible ? (
          <>
            <div className="logo">WENALI!</div>

            <div className="nav-icons">
              <IconButton className="more-button" onClick={toggleSidebar}>
                <MoreHorizIcon />
              </IconButton>
              <span onClick={handleSearchClick} className="search-icon">
                <SearchIcon />
              </span>
              <span>
                <Link to="/Login"><PersonIcon /></Link>
              </span>
              <span>
                <AddShoppingCartIcon />
              </span>
            </div>
          </>
        ) : (
          <div className={`search-container ${isSearchVisible ? 'show' : ''}`}>
            <input
              type="text"
              placeholder="Search..."
              className="search-input"
            />
            <button className="search-close" onClick={handleCloseSearch}>‚ùå</button>
          </div>
        )}
      </nav>

      <Drawer
        anchor="left"
        open={sidebarOpen}
        onClose={toggleSidebar}
        variant="temporary"
        sx={{
          '& .MuiDrawer-paper': {
            width: 250,
            boxSizing: 'border-box',
          },
        }}
      >
        <div className="sidebar">
          <List>
            <ListItem button component={Link} to="/" onClick={toggleSidebar}>
              <ListItemIcon><HomeIcon /></ListItemIcon>
              <ListItemText primary="Home" />
            </ListItem>
            <ListItem button component={Link} to="/shorts" onClick={toggleSidebar}>
              <ListItemIcon><YouTubeIcon /></ListItemIcon>
              <ListItemText primary="Shorts" />
            </ListItem>
            <ListItem button component={Link} to="/subscriptions" onClick={toggleSidebar}>
              <ListItemIcon><SubscriptionsIcon /></ListItemIcon>
              <ListItemText primary="Subscriptions" />
            </ListItem>
          </List>

          <div className="divider"></div>

          <List>
            <ListItem button component={Link} to="/your-channel" onClick={toggleSidebar}>
              <ListItemIcon><PersonIcon /></ListItemIcon>
              <ListItemText primary="Your Channel" />
            </ListItem>
            <ListItem button component={Link} to="/history" onClick={toggleSidebar}>
              <ListItemIcon><HistoryIcon /></ListItemIcon>
              <ListItemText primary="History" />
            </ListItem>
            <ListItem button component={Link} to="/Songs" onClick={toggleSidebar}>
              <ListItemIcon><PlaylistPlayIcon /></ListItemIcon>
              <ListItemText primary="Songs" />
            </ListItem>
            <ListItem button component={Link} to="/your-videos" onClick={toggleSidebar}>
              <ListItemIcon><VideoLibraryIcon /></ListItemIcon>
              <ListItemText primary="Your Videos" />
            </ListItem>
            <ListItem button component={Link} to="/watch-later" onClick={toggleSidebar}>
              <ListItemIcon><WatchLaterIcon /></ListItemIcon>
              <ListItemText primary="Watch Later" />
            </ListItem>
            <ListItem button component={Link} to="/liked-videos" onClick={toggleSidebar}>
              <ListItemIcon><ThumbUpAltIcon /></ListItemIcon>
              <ListItemText primary="Liked Videos" />
            </ListItem>
          </List>

          <div className="divider"></div>

          <List>
            <ListItem>
